import {useState} from 'react';

function List(){
const [num,setNum]=useState([1,2]);
const [show,setShow]=useState(false);
const [input, setInput]=useState('Enter here what do you need in todo');
return (<>
<button onClick={()=>{
    setShow(!show)
}}>show</button>
<input type='text' value={input}  onChange={(e)=>{
    [input, setInput]=useState('')
    setInput(e.target.value)
  
}}>
</input>
<button onClick={()=>{
    setNum([...num,input])
}}>add+</button>
{
    
    show && num.map((i)=>{
        return <Item i={i}></Item>
    })
}
</>

)
}
export default List;
